// App.js

import React, { useState, useEffect } from 'react';
import './App.css';
import Calendar from './Calendar';
import BlackDiv from './BlackDiv'; // Importuj nowy komponent
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Importuj BrowserRouter i Route
import axios from 'axios';

const App = () => {
  const [calendarDays, setCalendarDays] = useState([]);

  useEffect(() => {
    // Pobierz dni z backendu i ustaw je w stanie
    axios.get('http://localhost:5000/api/calendar')
      .then(response => {
        setCalendarDays(response.data);
      })
      .catch(error => {
        console.error('Error fetching calendar days:', error);
      });
  }, []);

  return (
    <Router> {/* Wrap w Router */}
      <div className="App">
        <h1>Calendar App</h1>
        <Route path="/" exact>
          <Calendar calendarDays={calendarDays} />
        </Route>
        <Route path="/test">
          <BlackDiv /> {/* Dodaj BlackDiv pod /test */}
        </Route>
      </div>
    </Router>
  );
};

export default App;
